Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (2,80,'Gospodaria Ungureni',null,'Casa Ungureni','Casa preotului','romani',null,'Casa cu prispa la fatada; lemn de fag; acoperis în patru ape; învelitoare din dranita de brad. Casa cuprinde trei încaperi camera de locuit, tinda si camara. Peretii sunt tencuiti an interior, iar în exterior doar din bîrne. Pe fatada principala are o prispa cu sase stîlpi ornamentati prin crestare. Acestia sustin grinda ce sprijina corniiacoperisului. Acoperisul reprezinta o treime din întreaga constructie, iar învelitoarea din sita însemna în zona etnografica Lapus o stare materiala prospera. Aceasta casa  a fost construita de comunitate avînd rolul de casa parohiala.',null);
Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (2,81,'Gospodarie de podgorean',null,'Teasc de struguri cu surub Baia Mare','Sitau','romani',null,'Teascul este de dimensiuni foarte mari, grinda de presare avand lungimea de 8 m si grosimea de 0,40 cm si fasonata pe patru fete.  Întreaga instalatie poate fi manevrata de doua persoane. Strugurii sunt pusi pe platforma într-un cos împletit din nuiele sau într-un cadru de scandura, peste ei se pun scanduri si boci de lemn pe care grinda preseaza direct. Pentru etanseizare, între grinzile platformei se punea stuf. Acesta era oparit si atunci se umfla. Într-un colt, una din panze avea o gaura prin care se colecta must. Noua expozitie de baza nu mai cuprinde în tematica în tematica expunerea presei. Pentru o mai buna valorificare în Muzeul Satului s-a construit un adapost pentru toate teascurile. Acesta este asezat langa casa de viticultor Cicarlau, iar în viitor va adaposti si recipente pentru pstrarea strugurilor si vinului.',null);
Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (2,82,'Gospodarie de podgorean',null,'Casa teascului din Cicarlau','Casa Sitaului','romani',null,'Constructie monocelulara; lemn de stejar; scandura de stejar; acoperis în patru ape; învelitoare din snopi de stuf. Teascul este de dimensiuni foarte mari, grinda de presare avand lungimea de 8 m si grosimea de 0,40 cm si fasonata pe patru fete.  Întreaga instalatie poate fi manevrata de doua persoane. Strugurii sunt pusi pe platforma într-un cos împletit din nuiele sau într-un cadru de scandura, peste ei se pun scanduri si boci de lemn pe care grinda preseaza direct. Noua expozitie de baza nu mai cuprinde în tematica în tematica expunerea presei. Pentru o mai buna valorificare în Muzeul Satului s-a construit un adapost pentru toate teascurile. Acesta este asezat langa casa de viticultor Cicarlau, iar în viitor va adaposti si recipente pentru pstrarea strugurilor si vinului.',null);
Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (2,83,'Gospodarie de podgorean',null,'Casa Cicarlau','Casa','romani',null,'Casa cu patru încaperi (camere de locuit, tinda, o camara, prispa în fata); barne de stejar; acoperis în patru ape; învelitoare din snopi de stuf',null);
Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (2,84,'Gospodarie de podgorean',null,'Teasc de struguri','Sitau','romani',null,'Instalatie pentru stors strugurii; forta umana. A fost achizitionat de la Sas Nicolae Astfel de teascuri existau în zona cuprinsa între Baia Mare si Seini, zona de dealuri în care s-a practicat intens viticultura. La sf. sec. XIX vinul produs aici era recunoscut ca fiind unul foarte bun chiar si la Viena. În 1900 vita de vie nobila a fost distrusa de filoxera si nu s-a mai cultivat. Prin anii 70 ai secolului XX s-a încercat refacerea zonei prin înfiintarea unei podgorii la Seini. Cuprinde Grinda de presare, platforma, fusul. Pentru presarea a 1.000 kg de struguri era necesara o noapte. Din cand în cand strugurii care cadeau erau adunati si pusi în partea superiaora, iar pentru manevrare erau suficienti doi oameni.',null);
Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (2,85,'Gospodarie de podgorean',null,'Teasc pentru struguri cu vana','Sitau','romani',null,'Teascul este asemanator cu cel din Cicarlau, dar de dimensiuni mult mai mici. Grinda de presare ete doar de 5 m. Acesta este trunchiul unui copat taiat la bifurcarea trunchiului în ramuri. Strugurii sunt însa pusi într-o vana confectionata din scanduri. Totul se sprijina pe un soclu realizat din lemn de stejar, care are un sant prin care se scurge mustul.',null);
