Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (10,807,'Darac Vama',null,'Darac Vama','Daracul lui Ilisoi','romani',null,'Temelia, putin elevata, consta din zidarie de piatra de cariera avand o întrerupere pentru grindei pe partea cu roata cu zbaturi. Peretii sunt realizati dintr-un schelet din barne de rasinoase pe care s-a batut scandura la exterior. Podeala din dulapi. Nu are pod.',null);
Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (10,808,'Darac Vama',null,'Darac Vama','Daracul lui Ilisoi','romani',null,'In momentul punerii in miscare a rotii cu cupe prin lovire la partea inferioara, aceasta actiona grindeiul in sensul invers fata de directia de curgere. Prin intermediul curelei de transmisie, miscarea circulara a grindeiului se transmite si axului din interiorul atelierului. Din atelier, cu ajutorul unei manete pot fi puse in functiune ambele masini simultan sau pe rand In functie de procesul tehnologic, transmisia de la ax la masini facandu-se tot prin curele de transmisie din piele. Dupa ce lana este scarmanata din mare la masina de scarmanat este finisata la daracul din imediata apropiere.',null);
