Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (10,811,'Piua Satu Mare',null,'Piua Satu Mare','Piua lui Clemente','romani',null,'Instalatia este compusa din 6 ciocane cu coada, axul cu came si piua cu trei gavane executata dintr-un trunchi de plop, interiorul este completat de un scoc si o buturuga scobita cu rol de aductiune a apei pentru lubrefierea lagarului plus un cuptor cu rezervor de apa calda.',null);
Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (10,812,'Piua Satu Mare',null,'Piua Satu Mare','Piua lui Clemente','romani',null,'constructie monocamerala din barne ce adaposteste instalatia pentru piua, tesaturile de lana si un cuptor cu plita',null);
