Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (12,847,null,null,'Casa Ilea',null,'romani',null,'Casa cu patru încaperi, prispa (satra) pe doua laturi; lemn de brad; acoperis în patru ape; învelitoare din dranita de brad',null);
Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (12,848,null,null,'Poarta Gorzo','Poarta Dancus - Nisoreanu','romani',null,'Poarta pe trei stalpi cu o portita (ustioara) sub acelasi acoperis. Ornamentul: rozete solare, ghinuri, linia în zig-zag dispuse pe toata suprafata celor trei stalpi. Aripile portii se termina în goluri în forma de unghi. Deasupra pragului portitei este un gol în forma de cerc realizat de cei patru chituri.',null);
Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (12,849,null,null,'Casa Dunca II',null,'romani',null,'Casa cu trei încaperi, prispa (satra) pe fata; lemn de brad; acoperis în patru ape; învelitoare din dranita de brad',null);
Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (12,850,null,null,'Casa Botizan',null,'romani',null,'Casa cu trei încaperi, prispa (satra) pe fata; lemn de stejar; acoperis în patru ape; învelitoare din dranita de brad',null);
Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (12,851,null,null,'Casa Barsan',null,'romani',null,'Casa cu patru încaperi, prispa (satra) pe doua laturi; lemn de brad; acoperis în patru ape; învelitoare din dranita de brad',null);
Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (12,852,null,null,'Camara','Casoaie','romani',null,'Camara cu o singura încapere, cu satra pe fata, cu o fereastra în peretele din stanga usii de intrare. Satra are trei stalpi prinsi în cununa, asigurati prin chitusi, realizand frumoase arcade.',null);
Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (12,853,null,null,'Camara Kosa','Camara','maghiari',null,'Constructie cu o singura încapere din barne de fag, cu usa de intrare din tablii de brad montate pe un ancadrament de stejar. Lateral dreapta, camara este prevazuta cu o mica fereastra. În fata o satra (pridvor) pe patru stalpi este închisa cu scandura de brad.',null);
Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (12,854,null,null,'Casa Ticala',null,'romani',null,'Casa cu prispa fara stalpi (tinda si camara); lemn de brad;acoperis în patru ape; învelitoare din dranita de brad',null);
Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (12,855,null,null,'Sura Kosa','Sura','maghiari',null,'Constructie din lemn de stejar;  barnele de la baza îmbinate în cheutoare nemteasca formeaza un cadru dreptunghiular pe care sunt fixati 12 stalpi, iar pe colturi sunt fixate scanduri verticale. În partea de jos, la colturi, contrafise oblice leaga stalpii de talpi. Sura are doua usi: usa din fata -  alcatuita din doua foi de scandura întarite cu cate o rama (formata din stinghii dispuse pe verticala si pe orizontala) si usa din spate.',null);
Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (12,856,null,null,'Camara','Casoaie','romani',null,'Constructie din barne de stejar cioplite, cu o fereastra mica pe peretele din stanga usii de intrare, care favorizeaza patrunderea luminii. Camara are satra în fata, sprijinita pe patru stalpi prinsi în cununa si asigurati prin chitusi (contrafise) care creeaza frumoase arcade. Satra este închisa cu scandura traforata.',null);
Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (12,857,null,null,'Casa Gorzo',null,'romani',null,'Casa cu patru încaperi, prispa (satra) pe fata; lemn de brad; acoperis în patru ape; învelitoare din dranita de brad',null);
Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (12,858,null,null,'Sopron','Oborog','ucrainieni',null,'Constructie din lemn de brad compusa din patru stalpi lungi, verticali, legati între ei atat în partea de sus si cat si jos la baza cu grinzi orizontale care dau constructiei o forma patrata. În partea de jos, între stalpi si grinzile de legatura este prinsa la fiecare stalp o tinga(contrafisa) din lemn. Stalpii sunt fixati pe pietre. Acoperisul în forma de piramida este prevazut cu cate un orificiu la cele patru colturi prin care patrund stalpii, prin care acesta gliseaza în functie de cantitatea de fan din sopron.',null);
Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (12,859,null,null,'Sura Balea','Sura','romani',null,'Sura are o singura încapere dreptunghiulara, cu barne cioplite în chetoare nemteasca, primul rand fiind din lemn de stejar, iar restul din lemn de brad. Sura are doua usi, una mai mare în fata si una mai mare în spate, care sunt ornamentate cu coarne de berbec puternic reliefate. În fata acoperisul se prelungeste. Acest spatiu protejeaza atelajele.',null);
Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (12,860,'Gospodaria Barsan',null,'Grajdul Barsan','grajd cu sura','romani',null,'Constructia are o sura mare la mijloc, de o parte cu grajd pentru cai sau boi, iar de cealalta grajdul vacilor si viteilor. Spatiile destinate animalelor sunt închise deasupra, formand podul în care se pastreaza furajele. Fiecare grajd are cate o usa de intrare. Între barne s-a tencuit cu pamant amestecat cu balega. Sura este prevazuta cu o usa mare la mijloc pentru a facilita intrarea carutei.',null);
Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (12,861,'Gospodaria Barsan',null,'Colejna','Colejna','romani',null,'Constructie pe patru stalpi, în fata doi stalpi înalti si în spate doi mai mici, legati între ei prin cununi puternice de stejar cu ajutorul chitusilor (contrafiselor).',null);
Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (12,862,'Gospodaria Bohotici',null,'Colejna Bohotici','Colejna','romani',null,'Scheletul constructiei este din lemn de stejar rotund, pe sapte stalpi legati în partea superioara pe orizontala de grinzi rotunde, întariti cu contrafise oblice la fiecare colt.',null);
Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (12,863,'Gospodaria Bohotici',null,'Grajdul Bohotici','Grajdul','romani',null,'Constructie din barne rotunde de fag, iar talpile (straturile) din barne cioplite de stejar. Constructia are doua compartimente: grajdul pentru vite  are o usa în fata cu o ferastruica alaturi si o usa în spate  si o deschidere spre sura pentru aprovizionarea cu fan a ieslei ;sura  cu o usa în fata si una în spate.',null);
Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (12,864,'Gospodaria Bohotici',null,'Casa Bohotici',null,'romani',null,'Casa cu trei încaperi, prin extensia acoperisului se formeaza o prispa fara stalpi; barne rotunde de fag; acoperis în patru ape; învelitoare din paie de grau si secara; motive geometrice la ancadramentul usii',null);
Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (12,865,'Gospodaria Bohotici',null,'Cotet Bohotici','Cotet','romani',null,null,null);
Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (12,866,'Gospodaria Botizan',null,'Cos pentru porumb','Cos pentru malai','romani',null,null,null);
Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (12,867,'Gospodaria Dunca I',null,'Sura brad','Sura','romani',null,'Sura are un singur compartiment în care se îmblateaucerealele, iar în zilele de sarbatoare se organiza jocul traditional. Deasupra, în podul suri se depozita fanul pentru animale. Constructia este din barne late de brad, cu o usa mare în fata, cu elemente decorative  linie în zig  zag si cruci, pe cele doua laturi verticale. Scandurile din care este alcatuita usa, dispuse vertical, sunt prinse cu cuie din lemn. Sistemul de închidere este tot din lemn. Acoperisul se prelungeste în fata cu aproximativ 3 m pentru a proteja constructia si alte unelte gospodaresti.',null);
Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (12,868,'Gospodaria Dunca I',null,'Cotet','Cotet','romani',null,'Constructie cu doua  încaperi din lemn de brad, cu o încapere pentru porci si una pentru scroafele cu purcei. Acoperisul în doua ape protejeaza si spatiul de sus utilizat pentru protejarea hranei.',null);
Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (12,869,'Gospodaria Dunca I',null,'Sura','Sura cu grajd','romani',null,'Constructia are doua încaperi: sura si grajdul. Talpa pe care se ridica constructia este cioplita, iar  celelalte barne sunt din lemn rotund. Sura are o usa mare în fata si o usa mai mica lateral. În spate se afla grajdul, cu un pod înalt pentru depozitat fanul.',null);
Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (12,870,'Gospodaria Tiplea',null,'Sura','Sura',null,null,'Construita din barne late de stejar. Are o singura încapere de forma dreptunghiulara în care se treierau (îmblîateau) cerealele cu îmblaciul. În partea de sus, în pod, se pastra fanul. Constructia are doua usi: una mare în fata si una mai mica în spate.',null);
Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (12,871,'Gospodaria Iurca',null,'Casa Iurca',null,'romani',null,'Constructie cu doua încaperi (cuptor si tinda) si  prispa pe doua laturi',null);
Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (12,872,'Gospodaria Iurca',null,'Cotet Iurca','Cotet','romani',null,'Cotetul are doua compartimente inegale ca dimensiune. Fiecare compartiment are la baza sapelor cate o deschidere pe toata lungimea sapei cu valau interior si unul exterior. În partea nordica are o satra cu doi capriori si chitusi la cununa de sustinere a acoperisului.',null);
Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (12,873,'Gospodaria Iurca',null,'Sopron Tiplea','Sopru','romani',null,'Constructie pe patru stalpi din lemn de stejar legati între ei atat în partea de sus, cat si de jos cu grinzi din lemn în forma de patrat (patru grinzi orizontale). Legatura între stalpi si grinzi este întarita cu cate doua contrafise oblice, iar în partea superioara legatura dintre stalpi si grinda este întarita cu cuie de lemn. Acoperisul în forma unei piramide, la cele patru colturi este prevazut cu orificii prin care patrund stalpii. Acoperisul este reglabil, în functie de cantitatea de fan depozitata în sopron.',null);
Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (12,874,'Gospodaria Marinca',null,'Casa Marinca',null,'romani',null,'Casa cu trei încaperi, prispa (satra) pe fata; lemn de brad; acoperis în patru ape; învelitoare din dranita de brad',null);
Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (12,875,'Gospodaria Marinca',null,'Cos pentru porumb  - Marinca','Cos pentru malai','romani',null,'Constructia de forma trapezoidala  cu baza mare sus. Cosul este împletit din nuiele de salcie (rachita) este sustinut de un schelet din lemn de stejar. Scheletul este format din patru stalpi legati între ei prin contrafise orizontale, iar în partea superioara acoperisul se sprijina pe o grinda (cununa) din lemn de stejar. În partea de jos se afla o usita pe unde se scot stiuletii de porumb.',null);
Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (12,876,'Gospodaria Marinca',null,'Cotet','Cotet','romani',null,'Cotetul are doua compartimente inegale ca marime. Fiecare spatiu are cate o usa. În partea de jos, langa usa, cotetul are cate o deschidere pentru valaul de hranire.',null);
Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (12,877,'Gospodaria Marinca',null,'Sopron Marinca','Sopru','romani',null,'Constructie pe patru stalpi din lemn de stejar legati între ei atat în partea de sus, cat si de jos cu grinzi din lemn în forma de patrat (patru grinzi orizontale). Legatura între stalpi si grinzi este întarita cu cate doua contrafise oblice, iar în partea superioara legatura dintre stalpi si grinda este întarita cu cuie de lemn. Acoperisul în forma unei piramide, la cele patru colturi este prevazut cu orificii prin care patrund stalpii. Acoperisul este reglabil, în functie de cantitatea de fan depozitata în sopron.',null);
Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (12,878,'Gospodaria Petrovai',null,'Grajd cu sura','Grajd cu sura','romani',null,'Constructia are trei încaperi: doua grajduri cu sura la mijloc. Unul din grajduri, cel pentru cai, este mai mare. De partea cealalta a surii este un grajd pentru vite.',null);
Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (12,879,'Gospodaria Petrovai',null,'Poarta Petrovai',null,'romani',null,'poarta pe trei stalpi legati în partea superioara cu un calaret: poarta mare pentru carute, cu doua aripi; lemn de stejar; acoperis în patru ape; învelitoare din dranita de brad; datata pe pragul de sus (1885); motive geometrice',null);
Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (12,880,'Gospodaria Petrovai',null,'Cotet','Cotet pentru porci si pasari','romani',null,'Constructie cu trei încaperi din lemn de brad: doua încaperi pentru porci si pe una din partile laterale este suspendat un mic spatiu pentru pasari, prevazut cu o scarita.',null);
Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (12,881,'Gospodaria Petrovai',null,'Casa Petrovai',null,'romani',null,'Casa cu patru încaperi, prispa (satra) pe trei laturi; lemn de brad; acoperis în patru ape; învelitoare din dranita de brad',null);
Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (12,882,'Gospodaria Petrovai',null,'Colejna','Colejna','romani',null,'Constructia se sprijina pe un schelet de stejar format din patru stalpi: doi mai înalti în fata si doi mai mici în spate, legati prin cununi puternice de stejar cu ajutorul chitusilor (contrafiselor). Acoperisul este în doua ape. Colejna este deschisa în fata si pe cele doua laturi, iar în spate esteînchisa printr-un gardulet din leturi verticale.',null);
Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (12,883,'Gospodaria Tivadar',null,'Casa Tivadar',null,'romani',null,'Casa cu trei încaperi, prispa (satra) pe doua laturi; lemn de stejar; acoperis în patru ape; învelitoare din dranita de brad',null);
Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (12,884,null,null,'Poarta Maris','Poarta','romani',null,'Poarta pe trei stalpi din stejar, ornamentati pe toata suprafata cu un sir continuu de romburi cu un cerc în mijloc, marginit de linii în zigzag de o parte si de alta, cu poarta mare pentru accesul animalelor si carutelor si portita/ustioara pentru accesul persoanelor  toate sub acelasi acoperis. În partea superioara cei trei stalpi sunt legati printr-o grinda numita cununa. Pe fetele stalpilor sunt realizate motive geometrice  un sir continuu de romburi cu m mic în mijlocul fiecarui romb, iar de o parte si de alta linia în zig-zag. Portita are în partea de sus o deschizatura rotunda cu patru chitusi ornamentati cu linia în  zigzag. Pe ambii stalpi ai portitei, în partea centrala a acestora  cate un vas cu flori si anul constructiei 1953 .Este trecut si numele proprietarului, Maris Vasile.',null);
