Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (12,901,null,null,'Colejna','Colejna','romani',null,'Constructia se sprijina pe patru stalpi de stejar, doi mai înalti în fata, peste care este asezata o grinda orizontala legata de stalpi cu chitusi si doi stalpi mai mici în spate. Pe grinda orizontala din fata si pe grinda superioara din spate se sprijina patru barne usor înclinate, pe care sta acoperisul constructiei. Este închisa lateral si în spate cu grinzi îmbinate în chetoare romaneasca.',null);
