Insert into ansamblu (ID_MUZEU,ID_ANSAMBLU,DENUMIREA_ANSAMBLULUI,TIPUL_ANSAMBLULUI,DENUMIREA_IN_MUZEU,DENUMIREA_LA_ORIGINE,ETNIA,DATAREA,DESCRIERE,IMPREJMUIRI) values (17,1165,null,'Gospodarie','Gospodaria Rusetu',null,'romani','1876',null,'(XI/D) Împrejmuire joasa, caracteristica gospodariilor din Campia Romana. Gardul împrejmuieste gospodaria numai la partea din fata (de la drum) a curtii; el se înalta pornind de la nivelul solului si este realizat din 11 stalpi din stejar cu sectiune dreptunghiulara, îngropati în pamant circa 30cm si legati unul de altul prin 2 randuri de leturi dispuse orizontal. Pe leturi au fost batute în cuie blanile din lemn de fag în pozitie verticala si cu spatii libere între ele de 2,5cm. Capetele superioare ale blanilor sunt cioplite artistic. Poarta mica este pentru accesul locuitorilor. Poarta mare, pentru car, se deschide spre interior si este formata din 2 batante, fiecare din ele fiind facuta din cate 5 blani de înaltimi diferite;  pornind de la îmbinarea fiecarei porti cu gardul, scandurile din care sunt formate se înalta treptat; ele au decor geometric, putin diferit de cel al gardului.');
